import React, { Component } from 'react';
import logo from './logo.svg';

class Nav extends Component {
    render() {
      return (
        <nav id="nav">
            <img src={logo} className="App-logo" alt="logo" />
        </nav>
      );
    }
  }

  export default Nav;
